instance.peoplecode_text:
Local Record &RC_rec;
Local Record &EMPLID_rec;
Local ProcessRequest &PRCSRQST;
Local number &PRCSNUM;
Local number &PRCSSTATUS;
Local string &PRCSSTATUS_str;
Local string &myDate;
Local string &rcID;
Local string &rcdttm; /* 9/8/06 */
Local string &user_emplid;
Local string &process_name;
Local string &report_type;
Local string &run_process_flag;
Component string &ButtonPressed;

Local number &class_number;

/* 2015/11/24 - WMS_M990 Variables begin */
Local string &report_repo;
Local string &content_id;
Local number &posted_status;
Local ProcessRequest &EPRCRQUST;
Local string &report_name_out;
/* for email runcontrol */
Local Record &EMAIL_rec;
Local string &email_rcID;

/* WMS_M990 Variables end */

/** Create a Record object for the run control to insert into
* and a record to put the empid in the RC_EMPLID table
*************************************************************/
&RC_rec = CreateRecord(Record.WMS_RC_R102);
&EMPLID_rec = CreateRecord(Record.WMS_RC_EMPLID);

&run_process_flag = "N";

If (&ButtonPressed = "APR") Then
   /*Warning ("APR Button");*/
   &process_name = "WMSR102A";
   &report_type = "APR";
End-If;
If (&ButtonPressed = "ITR") Then
   /*Warning ("ITR Button");*/
   &process_name = "WMSR102B";
   &report_type = "INT";
End-If;
If (&ButtonPressed = "TRC") Then
   /*Warning ("TRC Button");*/
   &process_name = "WMSR102B";
   &report_type = "TRAY";
End-If;

/** Build a unique(for this submission group) Run_CTL_ID              
*******************************************************/

/* 9/8/06  CS 8.9 Change runcontrol format from 
w1900001_at_2006-09-07-14.56.19.000000    to 
W1900001_at_20060907-14.56.19
---------1---------2---------3    */
/* &rcID = %UserId | "_at_" | %Datetime; */
&rcdttm = String(%Datetime);
&rcID = %UserId | "_at_" | Substring(&rcdttm, 1, 4) | Substring(&rcdttm, 6, 2) | Substring(&rcdttm, 9, 11);



/* now get the class number - based on term, subject, catalog_nbr, and section */
If (None(WMS_R102_WORK.CLASS_NBR)) And
      %Page = "WMS_PB_R102_COURSE" Then
   SQLExec("select class_nbr from ps_class_tbl where strm=:1 and class_section=:2 and subject=:3 and trim(catalog_nbr)=:4 and institution='WMS01'", WMS_R102_WORK.STRM, WMS_R102_WORK.CLASS_SECTION, WMS_R102_WORK.SUBJECT, WMS_R102_WORK.CATALOG_NBR, &class_number);
   If (None(&class_number)) Then
      Error MsgGet(21000, 99, "No course found for the given term, subject, catalog number, and section.");
   End-If;
Else
   &class_number = WMS_R102_WORK.CLASS_NBR;
End-If;


/** Do the insertions into WMS_RC_R102 */

&RC_rec.OPRID.Value = %UserId;
&RC_rec.RUN_CNTL_ID.Value = &rcID;
&RC_rec.WMS_TERM_LIMIT.Value = "9999";
&RC_rec.WMS_REPORT_TYPE.Value = &report_type;
&RC_rec.EMAIL_FLAG.Value = "Y";

&RC_rec.WMS_CLASS.Value = WMS_R102_WORK.WMS_CLASS;
&RC_rec.ACAD_PLAN_TYPE.Value = WMS_R102_WORK.ACAD_PLAN_TYPE;
&RC_rec.ACAD_PLAN.Value = WMS_R102_WORK.ACAD_PLAN;
&RC_rec.STRM.Value = WMS_R102_WORK.STRM;
&RC_rec.CLASS_NBR.Value = &class_number;
&RC_rec.WMS_FY_CLASS.Value = "";



/** Do the insertions into WMS_RC_EMPLID */

/* need to branch here based on the component - OPRID vs EMPLID
 * If OPRID (student), use of the %EmployeeId is OK. However, if a EMPLID (faculty), need to 
 * grab Emplid info from a field on the page. */
&EMPLID_rec.OPRID.Value = %UserId;
&EMPLID_rec.RUN_CNTL_ID.Value = &rcID;
&EMPLID_rec.EMPLID.Value = " ";
If (%Page = Page.WMS_PB_R102_OPRID) Then
   &EMPLID_rec.EMPLID.Value = %EmployeeId;
Else
   If (%Page = Page.WMS_PB_R102_EMPLID) Then
      &EMPLID_rec.EMPLID.Value = WMS_R102_WORK.EMPLID;
   End-If;
End-If;

If (Len(&EMPLID_rec.EMPLID.Value) > 1) Then

   &EMPLID_rec.Insert();
   &RC_rec.Insert();
   &run_process_flag = "Y";

Else

   If ((Len(&RC_rec.WMS_CLASS.Value) > 0) Or
         ((Len(&RC_rec.WMS_CLASS.Value) > 0) And
            (Len(&RC_rec.ACAD_PLAN_TYPE.Value) > 0) And
            (Len(&RC_rec.ACAD_PLAN.Value) > 0)) Or
         ((Len(&RC_rec.STRM.Value) > 0) And
            (Len(&RC_rec.CLASS_NBR.Value) > 0))) Then

      &RC_rec.Insert();
      &run_process_flag = "Y";

   End-If;

End-If;

If (&run_process_flag = "Y") Then

   &PRCSRQST = CreateProcessRequest();

   &PRCSRQST.ProcessType = "SQR Report";
   &PRCSRQST.ProcessName = &process_name;
   &PRCSRQST.RunControlID = &rcID;

   &PRCSRQST.RunLocation = "PSUNXSS";

   /*&PRCSRQST.OutDestType = "NONE";
   &PRCSRQST.OutDestFormat = "PDF";
   &PRCSRQST.OutDest = "NONE"*/
   &PRCSRQST.OutDestType = "WEB";
   &PRCSRQST.OutDestFormat = "PDF";

   &PRCSRQST.RunDateTime = %Datetime;
   &PRCSRQST.TimeZone = %ServerTimeZone;

   &PRCSRQST.Schedule();

   /* 2015/11/24 - WMS_M990 begin */
   /* prepare path to file (URL) for emailing */
   &report_name_out = Lower(&process_name) | "_" | &PRCSRQST.ProcessInstance | ".PDF";
   SQLExec("select url from ps_cdm_dist_node", &report_repo);
   SQLExec("select contentid from ps_cdm_list where prcsinstance=:1", &PRCSRQST.ProcessInstance, &content_id);

   /* set up rc table for the email process */
   &email_rcID = %UserId | "_at_" | Substring(&rcdttm, 1, 4) | Substring(&rcdttm, 6, 2) | Substring(&rcdttm, 9, 11);
   &EMAIL_rec = CreateRecord(Record.WMS_RC_M990);
   &EMAIL_rec.OPRID.Value = %UserId;
   &EMAIL_rec.RUN_CNTL_ID.Value = &email_rcID;
   &EMAIL_rec.WMS_PRNT_PRCSID.Value = &PRCSRQST.ProcessInstance;
   &EMAIL_rec.URL.Value = &report_repo;
   &EMAIL_rec.CONTENTID.Value = &content_id;
   &EMAIL_rec.FILENAME.Value = &report_name_out;
   &EMAIL_rec.MSG_SET_NBR.Value = 32000;
   If &process_name = "WMSR102A" Then
      &EMAIL_rec.MSG_NBR.Value = 2;
   End-If;
   If &process_name = "WMSR102B" Then
      &EMAIL_rec.MSG_NBR.Value = 4;
   End-If;
   &EMAIL_rec.WMS_POLL_INTERVAL.Value = 6;
   &EMAIL_rec.WMS_POLL_TRIES.Value = 10;
   &EMAIL_rec.Insert();

   &EPRCRQUST = CreateProcessRequest("Application Engine", "WMS_AE_M990");
   &EPRCRQUST.RunControlID = &email_rcID;
   &EPRCRQUST.RunLocation = "PSUNXSS";
   &EPRCRQUST.RunDateTime = %Datetime;
   &EPRCRQUST.TimeZone = %ServerTimeZone;
   &EPRCRQUST.ProcessInstance = &PRCSRQST.ProcessInstance;
   &EPRCRQUST.Schedule();

   /* WMS_M990 end */

Else

   Error MsgGet(21000, 99, "Required data is missing. Please enter it.");

End-If;

import PT_MCF_MAIL:*;

/* script variables */
Local time &time;
Local number &posted_status;
Local string &db_name;
Local number &i;
Local string &email_distrib;
Local string &path_to_report;
Local number &prev_post_status;
Local boolean &error_detected;

/* run control variables */
Local string &oprid;
Local string &run_cntl_id;
Local string &wms_prnt_prcsid;
Local number &msg_set_nbr;
Local number &msg_nbr;
Local string &email_sender;
Local string &email_to;
Local string &repo_url;
Local string &content_id;
Local string &filename;
Local number &poll_interval;
Local number &poll_tries;

/* populate the run control values */
SQLExec("SELECT RUNCNTLID, DBNAME FROM PSPRCSRQST WHERE PRCSINSTANCE = :1", GetRecord().PROCESS_INSTANCE.Value, &run_cntl_id, &db_name);
MessageBox(0, "", 99999, 99999, "&run_cntl_id is: " | &run_cntl_id);
SQLExec("SELECT oprid, wms_prnt_prcsid, msg_set_nbr, msg_nbr, email_sender, email_to, url, contentid, filename, wms_poll_interval, wms_poll_tries FROM ps_wms_rc_m990 WHERE run_cntl_id =:1", &run_cntl_id, &oprid, &wms_prnt_prcsid, &msg_set_nbr, &msg_nbr, &email_sender, &email_to, &repo_url, &content_id, &filename, &poll_interval, &poll_tries);


/* debugging */
/*
MessageBox(0, "", 99999, 99999, "&oprid is: ~" | &oprid | "~");
MessageBox(0, "", 99999, 99999, "&run_cntl_id is: ~" | &run_cntl_id | "~");
MessageBox(0, "", 99999, 99999, "&wms_prnt_prcsid is: ~" | &wms_prnt_prcsid | "~");
MessageBox(0, "", 99999, 99999, "&msg_set_nbr is: ~" | &msg_set_nbr | "~");
MessageBox(0, "", 99999, 99999, "&msg_nbr is: ~" | &msg_nbr | "~");
MessageBox(0, "", 99999, 99999, "&email_sender is: ~" | &email_sender | "~");
MessageBox(0, "", 99999, 99999, "&email_to is: ~" | &email_to | "~");
MessageBox(0, "", 99999, 99999, "&repo_url is: ~" | &repo_url | "~");
MessageBox(0, "", 99999, 99999, "&content_id is: ~" | &content_id | "~");
MessageBox(0, "", 99999, 99999, "&filename is: ~" | &filename | "~");
MessageBox(0, "", 99999, 99999, "&path_to_report is: ~" | &path_to_report | "~");
MessageBox(0, "", 99999, 99999, "&poll_interval is: ~" | &poll_interval | "~");
MessageBox(0, "", 99999, 99999, "&poll_tries is: ~" | &poll_tries | "~");
*/


/* wait until the report is posted */
&error_detected = False;
/* figure out polling interval and number of tries to get a posting status of 5.  defaults if not specified */
If None(&poll_interval) Then
   MessageBox(0, "", 99999, 99999, "Using default polling interval: 6 seconds");
   &poll_interval = 6;
End-If;
If None(&poll_tries) Then
   MessageBox(0, "", 99999, 99999, "Using default polling tries: 10");
   &poll_tries = 10;
End-If;
&i = 0;
&time = %Time;
&prev_post_status = - 1;

Repeat
   If %Time > AddToTime(&time, 0, 0, &poll_interval) Then
      &time = %Time;
      SQLExec("select diststatus from ps_cdm_list where prcsinstance=:1", &wms_prnt_prcsid, &posted_status);
      MessageBox(0, "", 99999, 99999, "Posted Status is: " | &posted_status | " for process: " | &wms_prnt_prcsid | " .");
   End-If;
   /* make it so we don't constantly check the status */
   SQLExec("exec DBMS_LOCK.SLEEP(" | &poll_interval | ")");
   /* way to escape if this is taking too long */
   /* if the current status is the same as the previous status 10 times, get out */
   If &prev_post_status = &posted_status Then
      &i = &i + 1;
      If &i = &poll_tries Then
         MessageBox(0, "", 99999, 99999, "Process hit the polling limit (" | &poll_tries | " tries at " | &poll_interval | " second intervals) with a status of " | &posted_status | ".");
         &error_detected = True;
         Break;
      End-If;
   Else
      &i = 0;
   End-If;
   &prev_post_status = &posted_status;
Until &posted_status = 5;


/* build the report URL */
/*for use in CS12TST ONLY*/
If (&db_name = "CS12TST") Then
   &repo_url = "https://ais-test.williams.edu/psreports/cs12tst";
End-If;
&path_to_report = &repo_url | "/" | &content_id | "/" | &filename;
MessageBox(0, "", 99999, 99999, "&path_to_report is: ~" | &path_to_report | "~");
/* build the email */
Local PT_MCF_MAIL:MCFOutboundEmail &email = create PT_MCF_MAIL:MCFOutboundEmail();
/* assign the individual pieces of the email */
/* If no from email provided, use default */
If None(&email_sender) Then
   rem &email.From = &db_name | "_noreply@williams.edu";
   &email.From = "peoplesoft_sr@williams.edu";
Else
   &email.From = &email_sender;
End-If;
/* If no to email provided, send to the OPRID */
If None(&email_to) Then
   SQLExec("select emailid from psoprdefn where oprid=:1", &oprid, &email_distrib);
   &email.Recipients = &email_distrib;
   MessageBox(0, "", 99999, 99999, "&email.Recipients is: " | &email.Recipients | " .");
Else
   /* need to figure out how to handle multiple oprids */
   SQLExec("select emailid from psoprdefn where oprid=:1", &email_to, &email_distrib);
   &email.Recipients = &email_distrib;
   MessageBox(0, "", 99999, 99999, "&email.Recipients is: " | &email.Recipients | " .");
End-If;
/* send error email if process didn't post */
If &error_detected Then
   &email.Subject = MsgGetText(32000, 3, "Error: Message text not found", &wms_prnt_prcsid);
   &email.Text = MsgGetExplainText(32000, 3, "Error: Message text not found", &wms_prnt_prcsid);
Else
   /* If we don't have the message to use and the report URL, send a generic message with the parent process ID */
   If All(&msg_nbr, &msg_set_nbr, &path_to_report) Then
      If (&msg_nbr = 2) Then
         /* forcing APRs to use the more generic email text */
         &msg_nbr = 4;
      End-If;
      &email.Subject = MsgGetText(&msg_set_nbr, &msg_nbr, "Error: Message text not found");
      &email.Text = MsgGetExplainText(&msg_set_nbr, &msg_nbr, "Error: Message text not found", &path_to_report);
   Else
      &email.Subject = MsgGetText(32000, 1, "Error: Message text not found");
      &email.Text = MsgGetExplainText(32000, 1, "Error: Message text not found", &wms_prnt_prcsid);
   End-If;
End-If;
&email.ContentType = "text/html";
Local integer &resp = &email.Send();
Local boolean &done;

/* fill out email error handling here? */
Evaluate &resp
When %ObEmail_Delivered
   /* every thing ok */
   &done = True;
   Break;

When %ObEmail_NotDelivered
   /*-- Check &email.InvalidAddresses, &email.ValidSentAddresses
and &email.ValidUnsentAddresses */
   &done = False;
   Break;

When %ObEmail_PartiallyDelivered
   /* Check &email.InvalidAddresses, &email.ValidSentAddresses
and &email.ValidUnsentAddresses; */
   &done = True;
   Break;

When %ObEmail_FailedBeforeSending
   /* Get the Message Set Number, message number;
Or just get the formatted messages from &email.ErrorDescription,
&email.ErrorDetails;*/

   &done = False;
   Break;
End-Evaluate;
